on_submit.value:
async () => {
  let save = await db.t_schedule.create({
    data: {
      schedule_name: local.scheduleName,
      id_activity_type: local.selectedActivity.value,
      start_date: local.startDate,
      end_date: local.endDate,
      duration: local.duration,
      location: local.location,
      created_date: new Date(),
      created_by: user.id,
      pic: local.selectedSenior.value,
    },
  });
  if (save) {
    local.selectedParticipant.map(async (item) => {
      let save_participant = await db.t_schedule_participant.create({
        data: {
          id_user: item.value,
          id_schedule: save.id,
          created_date: new Date(),
          created_by: user.id,
        },
      });
    });
    if (confirm("Data Saved, Input again?")) {
      local.scheduleName = "";
      local.duration = null;
      local.startDate = null;
      local.endDate = null;
      local.location = "";
      local.selectedParticipant = null;
      local.selectedSenior = null;
      local.selectedActivity = null;
      local.loading = false;
      local.participantList = [];
      local.seniorList = [];
      local.activityList = [];
      local.openDropdownParticipant = false;
      local.openDropdownSenior = false;
      local.openDropdownActivity = false;
      local.render();
    } else {
      local.scheduleName = "";
      local.duration = null;
      local.startDate = null;
      local.endDate = null;
      local.location = "";
      local.selectedParticipant = null;
      local.selectedSenior = null;
      local.selectedActivity = null;
      local.loading = false;
      local.participantList = [];
      local.seniorList = [];
      local.activityList = [];
      local.openDropdownParticipant = false;
      local.openDropdownSenior = false;
      local.openDropdownActivity = false;
      local.render();
      navigate("/institution/data/schedule");
    }
  }
}

